import React, {Component} from 'react';
import './App.css';
import {setDefaultLanguage, setLanguageCookie, setTranslations, translate} from "react-switch-lang";
import en from '../../i18/en.json';
import pl from '../../i18/pl.json';
import * as PropTypes from "prop-types";
import dummyText from "../dummyText"

setTranslations({en, pl });
setDefaultLanguage('pl');
setLanguageCookie();

class App extends Component {
  render() {
    return (
        <div className="App">
            <Navbar />
            <Section
                title="Section 1"
                subtitle={dummyText}
                dark={true}
                id="section1"
            />
            <Section
                title="Section 2"
                subtitle={dummyText}
                dark={false}
                id="section2"
            />
            <Section
                title="Section 3"
                subtitle={dummyText}
                dark={true}
                id="section3"
            />
            <Section
                title="Section 4"
                subtitle={dummyText}
                dark={false}
                id="section4"
            />
            <Section
                title="Section 5"
                subtitle={dummyText}
                dark={true}
                id="section5"
            />
        </div>
    );
  }
}

App.propTypes = {
  t: PropTypes.func.isRequired,
};

export default translate(App);
